Woohoo my @sephora #sephoraplaybox arrived today, super early since it initially said Saturday. I was totally surprised since there are no spoilers out for my box, item # ending in 298 🙂 I love my box ❤️ List of what I got 
@trestique mini highlighter crayon in the shade Maldives luminescent.
@grandecosmetics grande hydrating lip plumper,it's a gloss 
@tataharperskincare Resurfacing mask. 
@milkmakeup Blur Stick deluxe sample. 
@christopherobinparis cleansing purifying scrub with sea salt. Great size. 
And of course a perfume sample and I got @nestfragrances Black tulips 🌷 it's floral so it's just not for me and it has patchouli which I absolutely hate but hey it's something to try. 
Awesomeness me box again this this. #sephoraplay #sephora #playbox #subscription #beautysubscription #makeup #beauty #skincare #subscriptionbox #tataharper #milkmakeup #trestique #christopherobin #grandecosmetics #grandelips
